description:
Normally I don't get excited about this hybrid talk show stuff, but douchebag Jimmy Fallon really ups the bar in this crossover. XTINA performs with The Roots and Jimmy Fallon in his office, with only office supplies as their support.
Not to spoil it, but this is better than the &quot;real&quot; song on CD. She really sings here.

